from PyQt6.QtCore import Qt, QByteArray
from PyQt6.QtGui import QFont, QPixmap
from PyQt6.QtWidgets import (
    QWidget, QLabel, QVBoxLayout, QHBoxLayout, QGraphicsDropShadowEffect
)

from PyQt6.QtCore import QPropertyAnimation, QEasingCurve
from PyQt6.QtMultimedia import QMediaPlayer, QAudioOutput
from PyQt6.QtCore import QUrl


LOGO_B64 = """

""".strip()       
class _PulseLabel(QLabel):
    """Label whose glow pulses to imply activity."""
    def __init__(self, text, parent=None):
        super().__init__(text, parent)
        effect = QGraphicsDropShadowEffect(self)
        effect.setBlurRadius(15)
        effect.setOffset(0, 0)
        effect.setColor(Qt.GlobalColor.white)
        self.setGraphicsEffect(effect)

        anim = QPropertyAnimation(effect, b"blurRadius", self)
        anim.setStartValue(5)
        anim.setEndValue(25)
        anim.setDuration(1000)
        anim.setEasingCurve(QEasingCurve.Type.InOutQuad)
        anim.setLoopCount(-1)
        anim.start()
        self._anim = anim  # keep reference


class LoadingScreen(QWidget):
    """Rounded splash with title, pulsing label, optional logo, credits, and sound."""
    def __init__(self, parent=None):
        super().__init__(parent)
        self.setWindowFlags(Qt.WindowType.FramelessWindowHint |
                            Qt.WindowType.WindowStaysOnTopHint)
        self.setAttribute(Qt.WidgetAttribute.WA_TranslucentBackground)

        # Sound setup
        self.player = QMediaPlayer()
        self.audio_output = QAudioOutput()
        self.player.setAudioOutput(self.audio_output)
        self.audio_output.setVolume(50)  # 0-100
        self.player.setSource(QUrl.fromLocalFile("Loading Screen.mp3"))
        self.player.play()

        # --- existing code ---
        container = QWidget(self, objectName="container")
        container.setStyleSheet("#container{background:rgba(0,0,0,230);border-radius:18px;}")

        vbox = QVBoxLayout(container)
        vbox.setContentsMargins(40, 40, 40, 30)
        vbox.setSpacing(20)
        vbox.setAlignment(Qt.AlignmentFlag.AlignCenter)

        title = QLabel("Nursing Simulation Lab")
        title.setFont(QFont("Segoe UI", 26, QFont.Weight.Bold))
        title.setStyleSheet("color:white;")
        title.setAlignment(Qt.AlignmentFlag.AlignCenter)
        vbox.addWidget(title)

        self.loading_label = _PulseLabel("Loading")
        self.loading_label.setFont(QFont("Segoe UI", 20))
        self.loading_label.setStyleSheet("color:#00d1ff;")
        self.loading_label.setAlignment(Qt.AlignmentFlag.AlignCenter)
        vbox.addWidget(self.loading_label)

        #  credits row 
        credits_row = QHBoxLayout()
        credits_row.setSpacing(12)
        credits_row.addStretch(3)

        if LOGO_B64:
            pix = self._pixmap_from_b64(LOGO_B64)
            if pix.height() > 100:
                pix = pix.scaledToHeight(
                    100, Qt.TransformationMode.SmoothTransformation
                )
            logo_lbl = QLabel()
            logo_lbl.setPixmap(pix)
            logo_lbl.setAlignment(Qt.AlignmentFlag.AlignCenter)
            credits_row.addWidget(logo_lbl)
            credits_row.addStretch(1)

        devs = ("\nSanthosh\nSuganya\nAnushya\nDivya\nSundar\nSaravanan\nShameer")
        credits = QLabel(f"Developed by: {devs}")
        credits.setFont(QFont("Segoe UI", 10))
        credits.setStyleSheet("color:gray;")
        credits.setAlignment(Qt.AlignmentFlag.AlignRight | Qt.AlignmentFlag.AlignVCenter)
        credits_row.addWidget(credits)

        vbox.addLayout(credits_row)

        container.adjustSize()
        self.resize(container.size())
        container.move(0, 0)

    @staticmethod
    def _pixmap_from_b64(b64: str) -> QPixmap:
        data = QByteArray.fromBase64(b64.encode())
        pix = QPixmap()
        pix.loadFromData(data)
        return pix


if __name__ == "__main__":
    import sys
    from PyQt6.QtWidgets import QApplication

    app = QApplication(sys.argv)
    splash = LoadingScreen()
    splash.show()
    sys.exit(app.exec())
